import React, { useState } from 'react';

const SearchForm = () => {
  const [name, setName] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    // Perform search with name here
    console.log(`Searching for: ${name}`);
  };

  return (
    <form onSubmit={handleSubmit}>
      <label htmlFor="name">Search with name:</label>
      <input
        type="text"
        id="name"
        value={name}
        onChange={(e) => setName(e.target.value)}
      />
      <button type="submit">Search</button>

      <h3>Results:</h3>
      <ul>
        <li>
          EMP ID: 1, Name: Arjun, DOB: 16-11-2000, Role: Software Engineer
        </li>
        <li>
          EMP ID: 2, Name: Mahesh, DOB: 15-01-2000, Role: Web Developer
        </li>
      </ul>
    </form>
  );
};

export default SearchForm;
